import './footer.css';

class Footer extends Component{

    render(){
        return(
            <footer id="sticky-footer" class="py-4 bg-dark text-white-50">
                <div class="container text-center">
                    <small>Copyright &copy; Your Website</small>
                </div>
            </footer>
        );
    }
}
export default Footer;
